import axios from 'axios';
import React from 'react';
import { FormGroup, Label, Input } from 'reactstrap';
import URLStorage from '../../../../constants';
import MainForm from '../MainForm'

const Motivation = props => {


    return       <FormGroup>
    <Label for="exampleSelect">Motivation</Label>
    <Input type="select" name="motivationID" value={props.value} onChange={props.parentCallback}>
        {props.items.map((motivation, idx) =>
            <option key={idx} value={motivation.id}>{motivation.motivation}</option>)}
    </Input>    
</FormGroup>

}

export default Motivation;
